  \"Contaminant Assessment of White Suckers from Eight Rivers in the Gulf of Maine
  Distinct Population Segment for Atlantic Salmon\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  3,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:48:54.170971\",\n\t\"name\": \"contaminant-assessment-of-white-suckers-from-eight-rivers-in-the-gulf-of-maine-distinct-po\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"During development of the draft recovery
  plan for the Atlantic salmon, it was determined that insufficient information existed
  regarding environmental contaminants in eight Gulf of Maine rivers where the endangered
  Atlantic salmon is considered a Distinct Population Segment (DPS) under the Endangered
  Species Act. To address this data gap, white suckers (Catostomus commersoni) were
  collected for tissue residue analyses between 2003 and 2006 from the West Branch
  of the Sheepscot River, Ducktrap River, Cove Brook, Narraguagus River, Pleasant
  River, Machias River, East Machias River, and Dennys River. White suckers are a
  common sentinel species used in state, regional, and national biomonitoring programs
  to illustrate contaminant conditions and trends. Ninety whole-body white suckers
  from 27 locations in the eight rivers were separated into 47 samples (22 composites
  and 25 individuals) and analyzed for organochlorine compounds and trace elements
  in a screening-level contaminant survey.\",\n\t\"license_title\": \"License Not
